import React, { useState } from 'react';

function Button() {
  const [count, setCount] = useState(0);

  const increment = () => {
    setCount(count + 10);
  };

  const decrement = () => {
    setCount(count - 10);
  };

  const reset = () => {
    setCount(0);
  };

  return (
    <div>
      <h1>Count: {count}</h1>
      <button className="Different" type="button" onClick={increment}>Increment</button>
      <button className="Different" type="button" onClick={decrement}>Decrement</button>
      <button className="Different" type="button" onClick={reset}>Reset</button>
    </div>
  );
}

export default Button;
